import {useNavigate} from "react-router-dom";


import './styles.css'


//Propriedade com React - Definindo que o metodo vai receber Filhos (Children) e especificando dentro do H1 também
export default function Teste() {

    return (

        <div className="modal">
            <p></p>
            <center><h1>Míssel Enviado</h1></center>
            <center><h1>Para Rua Amazonas</h1></center>
            <center><h1>Bairro Umuarama, N°153, APT 7</h1></center>
        </div>

    )


}
